geregisseerd door Thanakorn Pongsuwan
met Sam Kasem, Preeti Barameeanant en Arucha Tosawat

Wanneer Tai wordt vrijgelaten uit de gevangenis, vindt hij zijn tweelingbroer Tan in een coma nadat hij de wereld van Fireball betrad. Fireball is een ondergrondse sport die op basketbal is gebaseerd. Tai wordt zelf ook lid van de sport, om te ontdekken wat en hoe het gebeurde. Hij zweert wraak te nemen...

